import './Linkedin.css';
import LinkedinIcon from '../../assets/linkedin.svg'

function Linkedin () {
    return (
        <footer>
            <a href="https://www.linkedin.com/in/bastien-cochet-47036b222/"><img className="iconLink" src={LinkedinIcon} alt="LinkedIn"></img></a>
        </footer>
    )
}

export default Linkedin;
